import React from 'react';
import {useEffect, useState} from 'react';
import './Project.scss';
import GalleryData from './../workData/Data';


export default function Project() {

  const [data, setData] = useState([]);
  const [filter, setFilter] = useState([]);
  const [activeButton, setActive] = useState();

  useEffect(()=>{
    setData(GalleryData);
  },[])  

  return (
    <section className='projects' id='projects'>
        <div className="project-container">
          <div className="heading-project">Projects</div>

          <div className="selection">
            <div className="list">All</div>
            <div className="list">UI/UX</div>
            <div className="list">Website</div>
            <div className="list">Coding</div>
          </div>

          <div className="gallery">
  
            {data.map((item)=>
              <div className="card-holder" key={item.id}>
                <div className="card-head">
                  <img className="card-img" src={item.image} alt="project item" />

                </div>
                  <div className="card-body">
                    <h2 className="item-name">{item.title}</h2>
                    <div className="item-date">{item.year}</div>
                  </div>

                <div className="card-hover">
                  <div className="card-hover-inside">
                    <div className="item-role">{item.role}</div>
                    <div className="item-type">{item.type}</div>
                    <div className="item-decs">{item.desc}</div>
                    <div className="click-more">Learn More</div>
                  </div>
                </div>
              </div>
  
            )}


          </div>
        </div>
        
    </section>
  )
}
